import React from "react";
import { useState } from "react";

const Form = () => {

    const [index, setIndex] = useState(0);
    function handleClick () {
        setIndex(index + 2);
    }

    return(
        <div>
            <button onClick={handleClick}>Clicked {index} times</button>
        </div>

    );
};

export default form;
